import React from "react";
import { DateValue } from "../RelativeDatePicker";
interface TabProps {
    target: Element;
    onChange: (value: DateValue) => void;
    untilToday?: boolean;
}
interface PanelProps extends TabProps {
    onCancel: () => void;
}
declare const CustomPanel: {
    ({ target, onChange, onCancel, untilToday }: PanelProps): React.JSX.Element;
    defaultProps: {
        untilToday: boolean;
    };
};
export default CustomPanel;
